  true,\n\t\"url\": null,\n\t\"notes\": \"The Greater New Orleans Biosciences Economic
  Development District (GNOBEDD), now referred to as BioDistrict New Orleans, is a
  state-enabled economic development district (with taxing and bonding authority)
  that was created by the State of Louisiana in 2005 and charged with the responsibility
  of growing both the programmatic and physical development components of the biosciences
  sector of the New Orleans economy (Louisiana State Legislature, 2005, ACT 487).
  \ Included in the .zip file are shapefiles for 'BioDistrict New Orleans' and 'BioDistrict
  Hospital Sites'.  More here: http://biodistrictneworleans.org/category/resources/.
